import React from "react";

function Header() {
  return (
    <header id="home" className="header valign bg-img parallaxie">
      <div className="container">
        <div className="row">
          <div className="col-md-12 text-center caption">
            <h1 className="animate-box" data-animate-effect="fadeInUp">
            सुमित <span style={{fontSize:'14px'}}>संग</span> प्रमीला
            </h1>
            <h5 className="animate-box" data-animate-effect="fadeInUp">
              4 मार्च, 2021 –चौपाल नं.2,गांव घॏण्डली कृष्णा नगर दिल्ली
            </h5>
          </div>
        </div>
        <div className="row">
          <div className="col-md-12">
            <div className="arrow bounce text-center">
              <a href="#couple">
                {" "}
                <i className="ti-heart"></i>{" "}
              </a>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
}

export default Header;
